import React from "react";
import { Link } from "react-router-dom";
import {
  PageContainer,
  Title,
  HeadlineContainer,
  Subtitle,
  Demo,
  Video,
  ContentContainer1,
  ContentContainer2,
  ContentContainer3,
  SubContainer,
} from "./styles/index_style.js";
import ReactPlayer from "react-player";
import landing_video from "../imgs/landing_video.mp4";
import before from "../imgs/ais_only.png";
import {
  CCard,
  CCardImage,
  CCardBody,
  CCardTitle,
  CCardText,
} from "@coreui/react";

function Home() {
  return (
    <>
      <PageContainer>
        <Video src={landing_video} autoPlay loop muted playsinline />
        <HeadlineContainer>
          <Title>The Future of Maritime Navigation</Title>
          <Demo to="/contact">Schedule a Demo</Demo>
        </HeadlineContainer>
      </PageContainer>
      <ContentContainer1>
        <SubContainer>
          <Subtitle>Navigate the Ocean like Never Before</Subtitle>
          <CCard style={{ width: "50%" }}>
            <CCardImage orientation="top" src={before} />
            <CCardBody>
              <CCardTitle>Card title</CCardTitle>
              <CCardText>
                Some quick example text to build on the card title and make up
                the bulk of the card's content.
              </CCardText>
            </CCardBody>
          </CCard>
        </SubContainer>
      </ContentContainer1>
    </>
  );
}

export default Home;
